VALUES ('3491841322609', '10 Feuilletés Jambon-fromage, 650 Grammes, Marque Chantegel', '10 FEUILLETÉS JAMBON FROMAGE CRUS SURGELÉS INGRÉDIENTS Pâte feuilletée (70%) : Farine de blé, eau, matières grasses végétales (matière grasse végétale de palme et colza, eau, sel, émulsifiant : mono et diglycérides d\'acides gras, acidifiant : acide citrique, conservateur : sorbate de potassium, colorant : béta carotène), sel/ dorure (eau, protéines de lait, sucre, poudre de fromage blanc, sel, colorant : rocou). Garniture (30%) : Eau, poudre de béchamel (lactosérum, amidon modifié de pomme de terre, amidon de blé, dextrose, matières grasses végétales de palme, sel, épaississant : alginate de sodium, stabilisant : diphosphate, sirop de glucose, caséinates), jambon 9,4%* (jambon de porc, eau, dextrose, sel, acidifiant : lactate de sodium, protéines de sang, arômes, stabilisants : triphosphate, diphosphate ; lactose, sirop de glucose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), fromage fondu 3,2%* (fromages, eau, beurre, lactosérum, poudre de lait écrémé, sel de fonte : orthophosphate de sodium, arôme, sel), arômes (contient lait). * Pourcentages exprimé sur la garniture. Traces de: soja, oeuf et fruits à coque. Les informations en gras sont destinées aux personnes allergiques ou intolérantes. CONSEILS DE PRÉPARATION : Sans décongélation. Préchauffer le four 10 min à 21 OOC (th7). Déposez les feuilletés bien séparés sur la plaque froide du four, recouverte de préférence d\'un papier sulfurisé ou aluminium. Enfournez à mi-hauteur et laisser cuire 25-30 min. Ne pas utiliser le four micro-ondes. CONSERVATION : * 24 h dans le réfrigétateur 3 jours dans le compartiment à glace du réfrigérateur Plusieurs mois dans le congélateur à -180C jusqu\'à la date indiquée sur l\'emballage PRODUIT DÉCONGELÉ', '', '12.2', '5.8', '30.4', '2.9', '', '4.7', '1.04', '0.409448818897638', '', '0');

